    const AddExpenseHandler=()=>{
        setExpense(true)
    }

    return(
        <React.Fragment>
            <AddExpenseForm onAdd={AddExpenseHandler} />
             <ExpenseDetails />
        </React.Fragment>
    )
}

export default AddExpense
